script: |
  super -f text -I q3235.spq | sort > q3235.out

inputs:
  - name: q3235.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + col1 + - 51 BETWEEN + 19 * CAST ( NULL AS REAL ) AND - + col1 - + col0;
  - name: tab1

outputs:
  - name: q3235.out
    data: |
      51	14	96
      85	5	59
      91	47	68
